protected String buildCacheKey(String typeName, String methodName,
    String argName) {
  StringBuilder buffer = new StringBuilder();
  buffer.append(typeName).append(".");
  buffer.append(methodName);
  if (argName != null) {
    buffer.append("::");
    buffer.append(argName);
  }
  return buffer.toString();
}
